  \"Report on Highly Pathogenic Avian Influenza Surveillance Activities for 2007-2008
  on Pocosin Lakes National Wildlife Refuge\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  6,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:38:09.503764\",\n\t\"name\": \"report-on-highly-pathogenic-avian-influenza-surveillance-activities-for-2007-2008-on-pocos\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Pungo Unit, designated as a globally
  important bird area, hosts large populations of waterfowl species that were identified
  for live bird or mortality surveillance for the Highly Pathogenic Avian Influenza
  H5N1 virus. Annually, over 100,000 migratory waterfowl winter on the Pungo Unit
  including 26,000 (24% of the Eastern Population of Tundra Swans), 78,000 Greater
  Snow Geese and 20 species of ducks.  Target species during the winter included Tundra
  Swans and other incidentally captured waterfowl species. During the spring and summer
  of 2008, target species included Wood Ducks during the banding season and other
  incidentally captured waterfowl (i.e.; mallards). Live birds were captured with
  rocket nets. As per the National Wildlife Health Center protocol, separate cloacal
  and oropharyngeal swabs were collected on all captured waterfowl and placed in a
  single vial. In addition, USFWS bands were placed on all newly captured birds and
  recaptured bands were recorded appropriately. Other data collected included species,
  sex, and age.  During the winter months, 120 Tundra Swans were live-captured and
  swabbed. During the spring and summer months, 19 Wood Ducks were live-captured and
  swabbed.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
